const index = () => {
  return (
    <div>
      <ul>
        <li><Link href="/"><a>Home</a> </Link></li>
        <li><Link href="/"><a>about</a> </Link></li>

      </ul>
      <h1>Welcome to BitzPrice</h1>
    </div>
  )
}

export default index
